class SoundButton extends Part {
    constructor({
        name,
        sound,
        button
    }) {
        super({
            name: "SoundButton"
        });
        this.sound = sound;
        this.button = button;
        this.isPlaying = false;
    }
    static singular = true;
    static properties = {
        sound: {
            type: "Part",
            subType: "Sound",
            description: "The sound object to control"
        },
        button: {
            type: "Part",
            subType: "Button",
            description: "The button that handles the controls"
        }
    };
    onMount() {
        if (!this.button || !this.sound) return;
        this.button.setOnClick(() => {
            if (this.isPlaying) {
                this.isPlaying = false;
                this.sound.pause();
            } else {
                this.isPlaying = true;
                this.sound.play();
            }
        })
    }
    act() {
        super.act();

    }
}
